import React from 'react'

const Index = (props) => {
    return <div>
        <label> Төрлийн дугаар:</label>
        <input
            disabled={props.updateAction ? "disabled" : ""}
            value={props.subType && props.subType.id}
            name="id"
            subType="number"
            onChange={props.handleInputChange}
            className="form-control"
            placeholder="Төрлийн дугаар"
            autoComplete="off"
        />
        <p className={css.errorMsg}>
            {props.errorMsg.id.show && props.errorMsg.id.message}
        </p></div>
}
